--[PERMIT_CLASSIFICATION_CD]: Include Facility Class(es) from the form on IMPACT. 
CREATE TABLE [dbo].VS_FACILITY_VIEW_PERMIT_CLASSIFICATION_CD_VAR ( 
		[TRANSACTION_ID] [bigint] NOT NULL,
		[PERMIT_CLASSIFICATION_CD] [varchar](16) NOT NULL,
		PRIMARY KEY ([TRANSACTION_ID],[PERMIT_CLASSIFICATION_CD]),
        CONSTRAINT FK_VS_FACILITY_VIEW_PERMIT_CLASSIFICATION_CD_VAR_VS_FACILITY_VIEW_VARS FOREIGN KEY ([TRANSACTION_ID]) REFERENCES VS_FACILITY_VIEW_VARS ([TRANSACTION_ID])
        )
GO

CREATE VIEW [dbo].VS_FACILITY_VIEW AS
	SELECT 
		FP_FACILITY.FP_ID AS FP_ID,
		FP_FACILITY.FACILITY_ID AS FACILITY_ID,
		DstnctFP.EMISSIONS_RPT_ID,
		--------------CERS_FAC_SITE Columns--------------
		ROW_NUMBER() OVER (ORDER BY FP_FACILITY.FP_ID ASC) AS FAC_SITE_ID,
		--'0': 'FacilityInventory'; '1': 'Point'; '2': 'Local'
		'1' AS CERS_ID,
		UPPER(FP_CERR_CLASS_DEF.CERR_CLASS_DESC) AS FAC_CATG_CODE, 
		FP_FACILITY.FACILITY_NM AS FAC_SITE_NAME,
		FP_FACILITY.FACILITY_DESC AS FAC_SITE_DESC,
		(CASE FP_FACILITY.OPERATING_STATUS_CD 
 			WHEN 'sd' THEN 'PS'
 				ELSE UPPER(FP_FACILITY.OPERATING_STATUS_CD)
 			END) AS FAC_SITE_STAT_CODE,
		FP_FACILITY_TYPE_DEF.FACILITY_TYPE_DSC AS SECT_TYPE_CODE, /*Currently this column had not been mapped in WY*/
		CAST(CM_ADDRESS.LATITUDE AS NUMERIC(8,5)) AS LAT_MEAS, 
 		CAST(CM_ADDRESS.LONGITUDE AS NUMERIC(8,5)) AS LONG_MEAS, 
		--------------CERS_FAC_IDEN Columns--------------
		RIGHT(FP_FACILITY.FACILITY_ID, 5) AS FAC_SITE_IDEN,
		--'GRICAQ' AS PROG_SYS_CODE,
		VS_FACILITY_VIEW_VARS.PROG_SYS_CODE,
		CM_COUNTY_DEF.FIPS_COUNTY_CD AS STA_AND_CNTY_FIPS_CODE,
		--------------CERS_FAC_SITE_ADDR Columns--------------
		ISNULL(QUARTER_QUARTER + ',', '')
			+ ISNULL(QUARTER + ',', '')
			+ ISNULL(CONVERT(VARCHAR, SECTION) + ',', '')
			+ ISNULL(TOWNSHIP + ',', '')
			+ ISNULL(RANGE, '') AS LOC_ADDR_TXT,
		COUNTY_NM AS LOCA_NAME,
		CM_ADDRESS.STATE_CD AS LOC_ADDR_STA_CODE,
		CM_ADDRESS.ZIP5 AS LOC_ADDR_POST_CODE,
		CM_ADDRESS.COUNTRY_CD AS LOC_ADDR_CTRY_CODE
	FROM 
		(SELECT
			DISTINCT FP_ID,
			MAX_EMIS_RPT_ID.EMISSIONS_RPT_ID
		FROM 
			--Select the most recently approved emission report(out of multiple revisions) in a specific year 
			(SELECT FP_ID, 
					REGULATORY_REQUIREMENT_CD, 
					EMISSIONS_RPT_ID = Max(RP_EMISSIONS_RPT.EMISSIONS_RPT_ID) 
			FROM dbo.RP_EMISSIONS_RPT
				INNER JOIN dbo.RP_EMISSIONS_RPT_SC_EMISSIONS_REPORT_XREF
					ON RP_EMISSIONS_RPT.EMISSIONS_RPT_ID =  RP_EMISSIONS_RPT_SC_EMISSIONS_REPORT_XREF.EMISSIONS_RPT_ID
				INNER JOIN dbo.SC_EMISSIONS_REPORT 
					ON RP_EMISSIONS_RPT_SC_EMISSIONS_REPORT_XREF.SC_EMISSIONS_REPORT_ID = SC_EMISSIONS_REPORT.SC_EMISSIONS_REPORT_ID
				INNER JOIN dbo.VS_FACILITY_VIEW_VARS
					ON RP_EMISSIONS_RPT.REPORT_YEAR = VS_FACILITY_VIEW_VARS.REPORT_YEAR
					AND VS_FACILITY_VIEW_VARS.TRANSACTION_ID = 1
			--WHERE REPORT_YEAR='2016'
			--RPT_RECEIVED_STATUS_CD ='10aa' --> The report is approved
			AND RPT_RECEIVED_STATUS_CD ='10aa'
			GROUP BY FP_ID, REGULATORY_REQUIREMENT_CD
			) MAX_EMIS_RPT_ID
		--Use the EMISSIONS_RPT_ID to get the SC_EMISSIONS_REPORT_ID (e.g. 1, 2, 3, 4, 5, 10, 11, 12, 14, 15, 17, 18, etc.)
		INNER JOIN 
			--Select the highest priority report(out of multiple rugulatory reports) which is required to report to USEPA
			(SELECT EMISSIONS_RPT_ID, PRIORITY = MAX(PRIORITY)
		    	FROM dbo.RP_EMISSIONS_RPT_SC_EMISSIONS_REPORT_XREF
					--Use the SC_EMISSIONS_REPORT_ID to join the table SC_EMISSIONS_REPORT to get the REGULATORY_REQUIREMENT_CD (e.g. TNTVP, TVP, UGRBNA, etc.)
					INNER JOIN dbo.SC_EMISSIONS_REPORT 
						ON RP_EMISSIONS_RPT_SC_EMISSIONS_REPORT_XREF.SC_EMISSIONS_REPORT_ID = SC_EMISSIONS_REPORT.SC_EMISSIONS_REPORT_ID
					--Use the REGULATORY_REQUIREMENT_CD to join the table RP_REGULATORY_REQUIREMENT_TYPE_DEF to get the PRIORITY and REPORT_TO_USEPA
					INNER JOIN dbo.RP_REGULATORY_REQUIREMENT_TYPE_DEF
						ON SC_EMISSIONS_REPORT.REGULATORY_REQUIREMENT_CD = RP_REGULATORY_REQUIREMENT_TYPE_DEF.REGULATORY_REQUIREMENT_CODE
						--REPORT_TO_USEPA = 'Y' --> The report type is required to report to USEPA
						AND REPORT_TO_USEPA = 'Y'
				GROUP BY EMISSIONS_RPT_ID
			) HIGHEST_PRI_RP
			ON  MAX_EMIS_RPT_ID.EMISSIONS_RPT_ID = HIGHEST_PRI_RP.EMISSIONS_RPT_ID
		) DstnctFP 
		INNER JOIN 	dbo.FP_FACILITY
			ON FP_FACILITY.FP_ID = DstnctFP.FP_ID
			--Use CERR_CLASS_CD to join the table FP_CERR_CLASS_DEF to get the CERR_CLASS_DESC
			--INNER JOIN should work. Currently it's OUTER JOIN in WY
			--INNER JOIN dbo.FP_CERR_CLASS_DEF
		LEFT OUTER JOIN dbo.FP_CERR_CLASS_DEF
			ON FP_FACILITY.CERR_CLASS_CD= FP_CERR_CLASS_DEF.CERR_CLASS_CD
		--Use FACILITY_TYPE_CD to join the table FP_FACILITY_TYPE_DEF to get the FACILITY_TYPE_DSC
		INNER JOIN dbo.FP_FACILITY_TYPE_DEF
			ON FP_FACILITY.FACILITY_TYPE_CD = FP_FACILITY_TYPE_DEF.FACILITY_TYPE_CD
		--Use FP_ID to join the table FP_FACILITY_ADDRESS_XREF to get the ADDRESS_ID
		LEFT OUTER JOIN dbo.FP_FACILITY_ADDRESS_XREF
			ON FP_FACILITY.FP_ID = FP_FACILITY_ADDRESS_XREF.FP_ID
		--Use ADDRESS_ID to join the table CM_ADDRESS to get the COUNTY_CD, LATITUDE, and LONGITUDE
		LEFT OUTER JOIN dbo.CM_ADDRESS
   			ON FP_FACILITY_ADDRESS_XREF.ADDRESS_ID = CM_ADDRESS.ADDRESS_ID
			--CM_ADDRESS.END_DT IS NULL --> The current address 
  			AND CM_ADDRESS.END_DT IS NULL
		--Use the COUNTY_CD to join the table CM_COUNTY_DEF to get the FIPS_COUNTY_CD
		LEFT OUTER JOIN dbo.CM_COUNTY_DEF 	
   			ON CM_ADDRESS.COUNTY_CD = CM_COUNTY_DEF.COUNTY_CD
		INNER JOIN dbo.VS_FACILITY_VIEW_VARS
			ON VS_FACILITY_VIEW_VARS.TRANSACTION_ID = 1
		INNER JOIN dbo.VS_FACILITY_VIEW_PERMIT_CLASSIFICATION_CD_VAR
			ON FP_FACILITY.PERMIT_CLASSIFICATION_CD = VS_FACILITY_VIEW_PERMIT_CLASSIFICATION_CD_VAR.PERMIT_CLASSIFICATION_CD
			AND VS_FACILITY_VIEW_PERMIT_CLASSIFICATION_CD_VAR.TRANSACTION_ID = 1
		--WHERE FP_FACILITY.PERMIT_CLASSIFICATION_CD IN ('ntv', 'smtv')
		/*WHERE-conditions in WY SQL
  		(v) REPORT_YEAR = 2016
  		(v) AND RPT_RECEIVED_STATUS_CD='10aa'
  		(v) AND REPORT_TO_USEPA = 'Y'
  		(v) AND PERMIT_CLASSIFICATION_CD IN ('ntv', 'smtv')
  		( ) AND FACILITY_TYPE_CD NOT IN ('-1')
		*/
GO




