--23.2.0/102. CREATE VIEW dbo.VS_EMISSION_UNIT_VIEW.sql
----

CREATE VIEW dbo.VS_EMISSION_UNIT_VIEW AS
	SELECT 
		FP_EMISSIONS_UNIT.EMU_ID AS EMU_ID, 
		CORR_EPA_EMU_ID,
		--------------CERS_EMIS_UNIT Columns--------------
		ROW_NUMBER() OVER (ORDER BY VS_FACILITY_VIEW.FAC_SITE_ID ASC) AS EMIS_UNIT_ID,		
		VS_FACILITY_VIEW.FAC_SITE_ID AS FAC_SITE_ID,
		LEFT(EU_DESC, 255) AS UNIT_DESC,
		CM_SCC.EPA_UNIT_TYPE_CD AS UNIT_TYPE_CODE,
		(CASE FP_EMISSIONS_UNIT.OPERATING_STATUS_CD 
 			WHEN 'sd' THEN 'PS'
 				ELSE UPPER(FP_EMISSIONS_UNIT.OPERATING_STATUS_CD)
 			END) AS UNIT_STAT_CODE,			--Currently UPPER(FP_EMISSIONS_UNIT.OPERATING_STATUS_CD) in WY
		CONVERT(DATETIME, INITIAL_STARTUP_DT, 120) AS UNIT_OPER_DATE, 
		--------------CERS_EMIS_UNIT_IDEN Columns--------------
		CORR_EPA_EMU_ID AS IDEN, 
		PROG_SYS_CODE AS PROG_SYS_CODE		
	FROM dbo.VS_FACILITY_VIEW
		--Use the FP_ID to join FP_EMISSIONS_UNIT to get all the emission unit
		INNER JOIN dbo.FP_EMISSIONS_UNIT
			ON VS_FACILITY_VIEW.FP_Id = FP_EMISSIONS_UNIT.FP_ID
		--Among all the emission units, not all of them are included in the emission inventory report. Only the N-N ones should be included.
		--Use the Emission_RPT_ID to join RP_REPORT_EU to get only the N-N EU
		INNER JOIN dbo.RP_REPORT_EU
			ON VS_FACILITY_VIEW.EMISSIONS_RPT_ID = RP_REPORT_EU.EMISSIONS_RPT_ID
			AND FP_EMISSIONS_UNIT.CORR_EPA_EMU_ID = RP_REPORT_EU.CORR_ID
			--EXEMPT_BY_EG71 = N: IS NOT "Less Than Report Requirement"
			--ZERO_EMISSIONS = N: IS NOT "Does Not Operate"
			AND EXEMPT_BY_EG71 = 'N' and ZERO_EMISSIONS = 'N'
		INNER JOIN
			--One Emission Unit could have 0 ~ multiple Emission Unit Process. 
			--Get the SMALLEST/Earliest?(ASC) Emission Unit Process and use that process SCC_ID to join CM_SCC and get the EPA_UNIT_TYPE_CD
			(SELECT FP_EMISSIONS_UNIT.EMU_ID, PROCESS_ID = MIN(FP_EMISSION_PROCESS.PROCESS_ID) 
				FROM dbo.FP_EMISSIONS_UNIT
				INNER JOIN dbo.FP_EMISSION_PROCESS
					ON  FP_EMISSIONS_UNIT.EMU_ID = FP_EMISSION_PROCESS.EMU_ID
				GROUP BY FP_EMISSIONS_UNIT.EMU_ID
			) MIN_PROCESS_ID 
			ON FP_EMISSIONS_UNIT.EMU_ID=MIN_PROCESS_ID.EMU_ID
		INNER JOIN dbo.FP_EMISSION_PROCESS
			ON FP_EMISSION_PROCESS.EMU_ID = MIN_PROCESS_ID.EMU_ID
			AND FP_EMISSION_PROCESS.PROCESS_ID = MIN_PROCESS_ID.PROCESS_ID
		INNER JOIN dbo.CM_SCC
			ON CM_SCC.SCC_ID = FP_EMISSION_PROCESS.SCC_ID
GO	




