--23.2.0/104. CREATE VIEW dbo.VS_EU_PROC_RP_VIEW.sql
----

--View of Emission Unit Process-Release Point: One release point could be attached to multiple Emission Unit Process/Control Equipment. 
--If 1 release point is attached to 2 Emission Unit Process/Control Equipment, there will be 2 records in this view. 
CREATE VIEW dbo.VS_EU_PROC_RP_VIEW AS
	SELECT 
		FP_EGRESS_POINT.FPNODE_ID,
		--------------CERS_EMS_UNT_PRC_RL_PT_APPR Columns--------------
		ROW_NUMBER() OVER (ORDER BY VS_EU_PROCESS_VIEW.EMIS_UNIT_PROC_ID ASC) AS EMIS_UNIT_PROC_REL_PT_APPR_ID,
		VS_EU_PROCESS_VIEW.EMIS_UNIT_PROC_ID, 
		CAST(RP.RELEASE_POINT_APPORTIONMENT AS NUMERIC(38,1)) AS AVE_PCNT_EMIS,
		--------------CERS_EMS_UNT_PRC_RL_PT_APPR Columns--------------
		IDEN + '-' + RELEASE_POINT_ID AS IDEN, 
		PROG_SYS_CODE AS PROG_SYS_CODE
	FROM dbo.VS_EU_PROCESS_VIEW
		CROSS APPLY dbo.udf_GetReleasePointApportionment(VS_EU_PROCESS_VIEW.FPNODE_ID) RP
		CROSS APPLY dbo.FP_EGRESS_POINT
			WHERE FP_EGRESS_POINT.FPNODE_ID = RP.TO_FPNODE_ID
GO	





