--23.2.0/105. CREATE VIEW dbo.VS_RP_VIEW.sql
----

CREATE VIEW dbo.VS_RP_VIEW AS
	SELECT 
		ROW_NUMBER() OVER (ORDER BY FACxRP.FPNODE_ID ASC) AS REL_PT_ID, 
		FACxRP.FAC_SITE_ID,  
		EPA_EGRESS_POINT_TYPE_CD AS REL_PT_TYPE_CODE,
		DAPC_DSC AS REL_PT_DESC, 
		ISNULL(RELEASE_HEIGHT, 0.00) AS REL_PT_STK_HGT_MEAS,
		'FT' AS REL_PT_STK_HGT_UNT_MEAS_CODE,
		ISNULL(DIAMETER, 0.00)	AS REL_PT_STK_DIA_MEAS,
		'FT' AS REL_PT_STK_DIA_UNT_MEAS_CODE,
		ISNULL(EXIT_GAS_VELOCITY, 0.00) AS REL_PT_EXIT_GAS_VEL_MEAS,
		'FPS' AS RL_PT_EXT_GS_VL_UNT_MS_CDE,
		ISNULL(EXIT_GAS_FLOW_AVG, 0.00) AS REL_PT_EXIT_GAS_FLOW_RATE_MEAS,
		'ACFM' AS RL_PT_EXT_GS_FLW_RTE_UNT_MS_CD,
		ISNULL(EXIT_GAS_TEMP_AVG, 100.00) AS REL_PT_EXIT_GAS_TMP_MEAS,
		(CASE OPERATING_STATUS_CD
			WHEN 'op' THEN 'OP'
			WHEN 'nop' THEN 'PS'
			ELSE 'PS' 
		END) AS REL_PT_STAT_CODE,
		ISNULL(CAST(FP_EGRESS_POINT.LAT_DEG AS NUMERIC(8,5)), FACxRP.LAT_MEAS) AS LAT_MEAS,
		ISNULL(CAST(FP_EGRESS_POINT.LONG_DEG AS NUMERIC(8,5)), FACxRP.LONG_MEAS) AS LONG_MEAS,
		'025' AS HORZ_COLL_METH_CODE, 			--'025': Classical Surveying Techniques
		'106' AS GEO_REF_PT_CODE, 				--'106': Point where substance is processed, treated, stored (point from which substance could be released into the environment)
		'004' AS COORD_DATA_SRC_CODE, 			--'004': The state of Arizona
		CONVERT(VARCHAR, FP_ID) + '-' + RELEASE_POINT_ID AS IDEN,
		PROG_SYS_CODE AS PROG_SYS_CODE
	FROM 
		(SELECT 
			DISTINCT VS_FACILITY_VIEW.FAC_SITE_ID, 
			VS_FACILITY_VIEW.FP_ID,
			VS_EU_PROC_RP_VIEW.FPNODE_ID, 
			VS_FACILITY_VIEW.LAT_MEAS, 
 			VS_FACILITY_VIEW.LONG_MEAS,
			VS_FACILITY_VIEW.PROG_SYS_CODE
		FROM dbo.VS_EU_PROC_RP_VIEW
			INNER JOIN dbo.VS_EU_PROCESS_VIEW
				ON VS_EU_PROC_RP_VIEW.EMIS_UNIT_PROC_ID = VS_EU_PROCESS_VIEW.EMIS_UNIT_PROC_ID
			INNER JOIN dbo.VS_EMISSION_UNIT_VIEW
				ON VS_EU_PROCESS_VIEW.EMIS_UNIT_ID = VS_EMISSION_UNIT_VIEW.EMIS_UNIT_ID
			INNER JOIN dbo.VS_FACILITY_VIEW
				ON VS_EMISSION_UNIT_VIEW.FAC_SITE_ID = VS_FACILITY_VIEW.FAC_SITE_ID
		) FACxRP
	INNER JOIN dbo.FP_EGRESS_POINT
		ON FACxRP.FPNODE_ID = FP_EGRESS_POINT.FPNODE_ID
	INNER JOIN dbO.FP_EGRESS_POINT_TYPE_DEF
		ON FP_EGRESS_POINT.EGRESS_POINT_TYPE_CD = FP_EGRESS_POINT_TYPE_DEF.EGRESS_POINT_TYPE_CD
GO		




