--23.2.0/106. CREATE VIEW dbo.VS_AFFILIATION_VIEW.sql
----

CREATE VIEW dbo.VS_AFFILIATION_VIEW AS
	SELECT 
		ROW_NUMBER() OVER (ORDER BY VS_FACILITY_VIEW.FAC_SITE_ID ASC) AS AFFL_ID,
		VS_FACILITY_VIEW.FAC_SITE_ID,
		'OW' AS AFFL_TYPE_CODE,					--Owner
		START_DATE AS AFFL_START_DATE,			--Currently this column had not been mapped in WY
		END_DATE AS AFFL_END_DATE,				--Currently this column had not been mapped in WY
		NAME AS ORG_FORMAL_NAME, 
		CM_COMPANY.COMPANY_ID, 
		CM_COMPANY.CMP_ID, 
		ADDRESS1 AS LOC_ADDR_TXT,
		ADDRESS2 AS SUPP_LOC_TXT,
		CITY AS LOCA_NAME,
		STATE_CD AS LOC_ADDR_STA_CODE,
		ZIP5 AS LOC_ADDR_POST_CODE,
		COUNTRY_CD AS LOC_ADDR_CTRY_CODE, 
		PHONE AS PHONE, 
		FAX AS FAX,
		PROG_SYS_CODE
	FROM dbo.VS_FACILITY_VIEW
		INNER JOIN dbo.FP_FACILITY_COMPANY_XREF
			ON VS_FACILITY_VIEW.FACILITY_ID = FP_FACILITY_COMPANY_XREF.FACILITY_ID
			AND FP_FACILITY_COMPANY_XREF.END_DATE IS NULL
		INNER JOIN dbo.CM_COMPANY
			ON FP_FACILITY_COMPANY_XREF.COMPANY_ID = CM_COMPANY.COMPANY_ID
		LEFT OUTER JOIN dbo.CM_ADDRESS
			ON CM_COMPANY.ADDRESS_ID = CM_ADDRESS.ADDRESS_ID
			AND CM_ADDRESS.END_DT IS NULL
GO




