--23.2.0/107. CREATE VIEW dbo.VS_AFFL_ORG_VIEW.sql
----

CREATE VIEW dbo.VS_AFFL_ORG_VIEW AS
	SELECT 
		ROW_NUMBER() OVER (ORDER BY VS_AFFILIATION_VIEW.AFFL_ID ASC) AS AFFL_ORG_ID,
		VS_AFFILIATION_VIEW.AFFL_ID AS AFFL_ID,
		ORG_FORMAL_NAME,
		COMPANY_ID AS IDEN,
		PROG_SYS_CODE AS PROG_SYS_CODE,
		LOC_ADDR_TXT,
		SUPP_LOC_TXT,
		LOCA_NAME,
		LOC_ADDR_STA_CODE,
		LOC_ADDR_POST_CODE,
		LOC_ADDR_CTRY_CODE, 
		PHONE, 
		FAX
	FROM dbo.VS_AFFILIATION_VIEW
GO	




