--23.2.0/108. CREATE VIEW dbo.VS_EU_PROC_RPT_PERIOD_VIEW.sql
----

--[START_DATE]: The start date of the Reporting Year.
--[END_DATE]: The end date of the Reporting Year.
CREATE TABLE [dbo].VS_EU_PROC_RPT_PERIOD_VIEW_VARS ( 
		[TRANSACTION_ID] [bigint] PRIMARY KEY NOT NULL,
        [START_DATE] [varchar](10) NOT NULL,
        [END_DATE] [varchar](10) NOT NULL
        )
GO

CREATE VIEW dbo.VS_EU_PROC_RPT_PERIOD_VIEW AS
	SELECT 
		RP_EMISSION_PERIOD.EMISSION_PERIOD_ID, 
		ROW_NUMBER() OVER (ORDER BY VS_EU_PROCESS_VIEW.EMIS_UNIT_PROC_ID ASC) AS EMIS_UNIT_PROC_RPT_PRD_ID,
		VS_EU_PROCESS_VIEW.EMIS_UNIT_PROC_ID,
		'A' AS RPT_PRD_TYPE_CODE, 				/*'A': Annual-The total emissions for a full year; 'W': Winter-The total emissions for the Dec 1 thru Feb 28 CO season*/
		'R' AS EMIS_OPER_TYPE_CODE,				/*'R': Routine-The normal or typical emissions for a reporting period*/
		VS_EU_PROC_RPT_PERIOD_VIEW_VARS.START_DATE AS START_DATE,
		VS_EU_PROC_RPT_PERIOD_VIEW_VARS.END_DATE AS END_DATE,
		HOURS_PER_YEAR AS ACTL_HOURS_PER_PRD,
		WINTER_THROUGHPUT_PCT AS PCNT_WINTER_ACT,
		SPRING_THROUGHPUT_PCT AS PCNT_SPRING_ACT,
		SUMMER_THROUGHPUT_PCT AS PCNT_SUMMER_ACT,
		FALL_THROUGHPUT_PCT AS PCNT_FALL_ACT
	FROM dbo.VS_FACILITY_VIEW
		INNER JOIN dbo.VS_EMISSION_UNIT_VIEW
			ON VS_FACILITY_VIEW.FAC_SITE_ID = VS_EMISSION_UNIT_VIEW.FAC_SITE_ID
		INNER JOIN dbo.RP_REPORT_PERIOD_XREF
			ON VS_FACILITY_VIEW.EMISSIONS_RPT_ID = RP_REPORT_PERIOD_XREF.EMISSIONS_RPT_ID
			AND VS_EMISSION_UNIT_VIEW.CORR_EPA_EMU_ID= RP_REPORT_PERIOD_XREF.CORR_ID
		INNER JOIN dbo.RP_EMISSION_PERIOD
			ON RP_REPORT_PERIOD_XREF.EMISSION_PERIOD_ID = RP_EMISSION_PERIOD.EMISSION_PERIOD_ID
		INNER JOIN dbo.VS_EU_PROCESS_VIEW
			ON VS_EU_PROCESS_VIEW.SRC_CLASS_CODE = RP_EMISSION_PERIOD.SCC_ID
			AND VS_EU_PROCESS_VIEW.EMIS_UNIT_ID = VS_EMISSION_UNIT_VIEW.EMIS_UNIT_ID
		INNER JOIN dbo.VS_EU_PROC_RPT_PERIOD_VIEW_VARS
			ON VS_EU_PROC_RPT_PERIOD_VIEW_VARS.TRANSACTION_ID = 1
GO





