--23.5.0/004. Create view VS_FACID_VIEW.sql
----



CREATE VIEW [dbo].[VS_FACID_VIEW] AS

--ALTER VIEW dbo.FACIDView AS

	SELECT
		FP_FACILITY.FP_ID AS FP_ID,
		FP_FACILITY.FACILITY_ID AS FACILITY_ID,
		--------------FACID_FAC_DTLS Columns--------------
		ROW_NUMBER() OVER (ORDER BY FP_FACILITY.FP_ID ASC) AS FAC_DTLS_ID,
		--------------FACID_FAC Columns-------------------
		FP_FACILITY.END_DT AS DELETED_ON_DATE,
		(CASE FP_FACILITY.VERSION_ID 
 			WHEN -1 THEN 'Y'
 				ELSE 'N'
 			END) AS FAC_ACTIVE_INDI,			
		FACILITY_NM AS FAC_SITE_NAME,
		FP_FACILITY.FP_ID AS FAC_SITE_IDEN_VAL,		/*?*/
		FP_FACILITY.FACILITY_TYPE_CD AS FAC_SITE_TYPE_CODE,
		FP_FACILITY_TYPE_DEF.FACILITY_TYPE_DSC AS FAC_SITE_TYPE_NAME,
		ISNULL(CM_ADDRESS.ADDRESS1 + ' ', '')
			+ ISNULL(CM_ADDRESS.ADDRESS2 + ',', '')
			+ ISNULL(CM_ADDRESS.CITY + ',', '')
			+ ISNULL(CM_STATE_DEF.STATE_NM + ' ', '')
			+ ISNULL(CM_ADDRESS.ZIP5 + ' ', '')
			+ ISNULL(CM_COUNTRY_DEF.COUNTRY_DSC, '') AS LOC_ADDR_TEXT,
		ISNULL(CM_ADDRESS.QUARTER_QUARTER + ',', '')
			+ ISNULL(CM_ADDRESS.QUARTER + ',', '')
			+ ISNULL(CONVERT(VARCHAR, CM_ADDRESS.SECTION) + ',', '')
			+ ISNULL(CM_ADDRESS.TOWNSHIP + ',', '')
			+ ISNULL(CM_ADDRESS.RANGE, '') AS SUPP_LOC_TEXT,
		CM_ADDRESS.STATE_CD AS STA_CODE,
		CM_STATE_DEF.STATE_NM AS STA_NAME,
		CM_ADDRESS.ZIP5 AS ADDR_POST_CODE_VAL,
		CM_ADDRESS.COUNTRY_CD AS CTRY_CODE,
		CM_COUNTRY_DEF.COUNTRY_DSC AS CTRY_NAME,
		CM_ADDRESS.CITY AS CNTY_NAME, 
		--------------FACID_ENVR_INTR Columns-------------------
		'Air ' +  ISNULL(FP_PERMIT_CLASSIFICATION_DEF.PERMIT_CLASSIFICATION_DSC, '') AS ENVR_INTR_TYPE_TEXT,
		--------------FACID_FAC_PRI_GEO_LOC_DESC Columns-------------------
		CAST(CM_ADDRESS.LATITUDE AS NUMERIC(8,5)) AS LATITUDE, 
 		CAST(CM_ADDRESS.LONGITUDE AS NUMERIC(8,5)) AS LONGITUDE 
	FROM dbo.FP_FACILITY
		LEFT OUTER JOIN dbo.FP_FACILITY_TYPE_DEF 
			ON FP_FACILITY.FACILITY_TYPE_CD = FP_FACILITY_TYPE_DEF.FACILITY_TYPE_CD
		--Use FP_ID to join the table FP_FACILITY_ADDRESS_XREF to get the ADDRESS_ID
		LEFT OUTER JOIN dbo.FP_FACILITY_ADDRESS_XREF
			ON FP_FACILITY.FP_ID = FP_FACILITY_ADDRESS_XREF.FP_ID
		--Use ADDRESS_ID to join the table CM_ADDRESS to get the COUNTY_CD, LATITUDE, and LONGITUDE
		LEFT OUTER JOIN dbo.CM_ADDRESS
   			ON FP_FACILITY_ADDRESS_XREF.ADDRESS_ID = CM_ADDRESS.ADDRESS_ID
		LEFT OUTER JOIN dbo.CM_STATE_DEF 
			ON CM_ADDRESS.STATE_CD=CM_STATE_DEF.STATE_CD
		LEFT OUTER JOIN dbo.CM_COUNTRY_DEF 
			ON CM_ADDRESS.COUNTRY_CD=CM_COUNTRY_DEF.COUNTRY_CD
		LEFT OUTER JOIN dbo.FP_PERMIT_CLASSIFICATION_DEF
		ON FP_FACILITY.PERMIT_CLASSIFICATION_CD = FP_PERMIT_CLASSIFICATION_DEF.PERMIT_CLASSIFICATION_CD
	--CM_ADDRESS.END_DT IS NULL --> The current address 
	WHERE CM_ADDRESS.END_DT IS NULL
		AND FP_FACILITY.VERSION_ID = -1
GO






