--23.5.0/005. Create view VS_FACID_AFF_VIEW.sql
----



CREATE VIEW [dbo].[VS_FACID_AFF_VIEW] AS

	SELECT
		--------------FACID_FAC_FAC_AFFL Columns-----------
		FACID_FAC.FAC_ID,
		CM_CONTACT_TYPE_DEF.CONTACT_TYPE_DSC AS AFFL_TYPE_TEXT,
		CM_CONTACT_CONTACT_TYPE_XREF.START_DATE AS AFFL_START_DATE,
		CM_CONTACT_CONTACT_TYPE_XREF.END_DATE AS AFFL_END_DATE,
		--------------FACID_AFFL Columns-------------------
		ROW_NUMBER() OVER (ORDER BY VS_FACID_VIEW.FAC_DTLS_ID ASC, CM_CONTACT.CONTACT_ID ASC) AS  AFFL_ID,
		VS_FACID_VIEW.FAC_DTLS_ID,
		--CAST(FACIDView.FAC_DTLS_ID as varchar)  +'_' + CAST(CM_CONTACT.CONTACT_ID AS VARCHAR) AS AFFL_IDEN,
		ROW_NUMBER() OVER (ORDER BY VS_FACID_VIEW.FAC_DTLS_ID ASC, CM_CONTACT.CONTACT_ID ASC, CM_CONTACT_TYPE_DEF.CONTACT_TYPE_DSC) AS AFFL_IDEN,
		NULL AS INDV_TITLE_TEXT,
		TITLE_CD AS NAME_PREFIX_TEXT,
		ISNULL(CM_CONTACT.FIRST_NM + ', ', '')
			+ ISNULL(CM_CONTACT.MIDDLE_NM + ', ', '')
			+ ISNULL(CM_CONTACT.LAST_NM, '') AS INDV_FULL_NAME,
		FIRST_NM AS FIRST_NAME,
		MIDDLE_NM AS MIDDLE_NAME,
		LAST_NM AS LAST_NAME,
		SUFFIX AS NAME_SUFFIX_TEXT,
		--------------FACID_TELEPHONIC Columns-------------	
		PHONE_NO AS PRIM_TELE_NUM_TEXT,
		PHONE_EXTENSION_VAL AS PRIM_TELE_EXT_NUM_TEXT,
		SECONDARY_PHONE_NO	AS SEC_TELE_NUM_TEXT,
		SECONDARY_EXTENSION_VAL AS SEC_TELE_EXT_NUM_TEXT,
		MOBILE_PHONE_NO	AS MOB_TELE_NUM_TEXT,
		FAX_NO AS FAX_TELE_NUM_TEXT,
		--------------FACID_AFFL_ELEC_ADDR Columns---------
		EMAIL_ADDRESS_TXT AS ELEC_ADDR_TEXT,
		'Email' AS ELEC_ADDR_TYPE_NAME
	FROM dbo.VS_FACID_VIEW
		INNER JOIN [VNDATA.CLOUDAPP.NET,56789].[GRIC_VES_FACID].[dbo].[FACID_FAC]
			ON VS_FACID_VIEW.FAC_DTLS_ID = FACID_FAC.FAC_DTLS_ID
		INNER JOIN dbo.CM_CONTACT_CONTACT_TYPE_XREF
			ON VS_FACID_VIEW.FACILITY_ID = CM_CONTACT_CONTACT_TYPE_XREF.FACILITY_ID
		LEFT OUTER JOIN dbo.CM_CONTACT
			ON CM_CONTACT_CONTACT_TYPE_XREF.CONTACT_ID = CM_CONTACT.CONTACT_ID
		LEFT OUTER JOIN dbo.CM_CONTACT_TYPE_DEF
			ON CM_CONTACT_CONTACT_TYPE_XREF.CONTACT_TYPE_CD = CM_CONTACT_TYPE_DEF.CONTACT_TYPE_CD
	WHERE CM_CONTACT_CONTACT_TYPE_XREF.END_DATE IS NULL 
GO






